import scala.util.Random
import scala.collection.mutable.ArrayBuffer
import scala.math.{abs => scalaAbs, exp => scalaExp, pow => scalaPow, cos => scalaCos}

import breeze.integrate.{trapezoid, simpson}
import breeze.stats.distributions.Gaussian
import breeze.numerics.constants.Pi


case class Datapoint(value: Double, time: Double)

case class TimeSeries(datapoints: Array[Datapoint])

def getK(D: Double = 1, a: Double = 1) =
    (t: Double) => scalaExp(-a * scalaAbs(t)) * (1 - a * scalaAbs(t))

def getSy(D: Double = 1, a: Double = 5) =
    (w: Double) => 4 * D * a * scalaPow(w / (a * a + w * w), 2)

def getH(D: Double = 1, a: Double = 5, sigma: Double = 1) =
    (t: Double) => (2 * Pi * scalaPow(4 * D * a, 0.5) / sigma) * scalaExp(-a * t) * (1 - a * t)

def average(arr: Array[Double]): Double = arr.sum / arr.length

def mean(arr: Array[Double]): Double = average(arr)

def variance(arr: Array[Double]): Double = {
    val sEV = average(arr)
    average(arr.map(i => scala.math.pow(i - sEV, 2)))
}

def normalValue = {
    val GaussianDistribution = Gaussian(0, 1)
    GaussianDistribution.draw()
}

def getWhiteNoise(count: Int) = (0 until count).map(Datapoint(normalValue, _)).toArray

// Bootstrap functions
def generateSample(arr: Array[Double], n: Int): Array[Double] = {
    val buf = new ArrayBuffer[Double]()
    (0 until n).foreach(i => buf += arr((n * Random.nextFloat).toInt))
    buf.toArray
}

def calcIntervalStatistic(arr: Array[Double], m: Int, statistic: Array[Double] => Double): (Double, Double) = {
    val point_stat = statistic(arr)

    val samples = (0 to m).map(i => generateSample(arr, arr.length))
    val statistics = samples.map(statistic).toArray
    val S2 = variance(statistics)
    val s = scala.math.pow(S2, 0.5)
    (point_stat - 3 * s, point_stat + 3 * s)
}

def realisation(h: Double => Double, x: Array[Double], time: Double, count: Int = 100): TimeSeries = {
    val dTau = time / count
    TimeSeries((0 until count).map(j => Datapoint(dTau * (0 to j).map(i => h(i * dTau) * x(j - i)).sum, j * dTau)).toArray)
}

val yCount = 1000
val realizationsCount = 200
val time = 20.0

val realisations = (0 until realizationsCount).map(_ => {
    val whiteNoise = getWhiteNoise(yCount).map(_.value).toArray
    realisation(getH(), whiteNoise, time, yCount)
})

def ck(k: Int, dTau: Double): Double = {
    val wc = Pi / dTau
    (1 / wc) * simpson(w => scalaPow((wc / Pi) * getSy()(w), 0.5) * scalaCos(k * Pi * w / wc), 0, wc, 99999)
}

def rollingSummationRealisation(x: Array[Double], c: Array[Double], time: Double, count: Int = 100): TimeSeries = {
    val dTau = time / count
    TimeSeries((0 until count).map(j => Datapoint((0 to j).map(i => c(i) * x(j - i)).sum, j * dTau)).toArray)
}

val yCount2 = 1000
val realizationsCount2 = 200
val time2 = 20.0
val dTau2 = time2 / yCount2
val c2 = (0 until yCount2).map(ck(_, dTau2)).toArray

val realisations2 = (0 until realizationsCount2).map(_ => {
    val whiteNoise = getWhiteNoise(yCount2).map(_.value).toArray
    rollingSummationRealisation(whiteNoise, c2, time2, yCount2)
})

// Integration and division by T is equal to finding average.
val M = mean(realisations(0).datapoints.map(_.value))
val D = variance(realisations(0).datapoints.map(_.value))

val meansByTimeLow = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(calcIntervalStatistic(section, 20, mean)._1, realisations(0).datapoints(i).time)
    }
)

val meansByTimeMedium = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(mean(section), realisations(0).datapoints(i).time)
    }
)

val meansByTimeHigh = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(calcIntervalStatistic(section, 20, mean)._2, realisations(0).datapoints(i).time)
    }
)

val variancesByTimeLow = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(calcIntervalStatistic(section, 20, variance)._1, realisations(0).datapoints(i).time)
    }
)

val variancesByTimeMedium = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(variance(section), realisations(0).datapoints(i).time)
    }
)

val variancesByTimeHigh = realisations(0).datapoints.indices
    .map(i => {
        val section = realisations.map(r => r.datapoints(i).value).toArray
        Datapoint(calcIntervalStatistic(section, 20, variance)._2, realisations(0).datapoints(i).time)
    }
)
